"""
Test FivePrimeUTRSeq.__getitem__()
"""

import pytest
from tests.UTR.config_UTR import FivePrimeUTRSeq_object, FivePrimeUTRSeq_object_minus_strand
from pybedtools import Interval


def test_constructor(FivePrimeUTRSeq_object):
    res = FivePrimeUTRSeq_object[1]
    assert res == {
        '':
            Interval(22, 22489399, 22509154, "5' UTR", 0, "+"),
        'transcripts': ['ENST00000399163.6'],
        'exons': [
            ('CGCGGCCCCAAGCGGTTCCCGAGCCCAGGCCCGCGCCGAGCCCAG', Interval(22, 20965163, 20965207, 'ENSE00001536777.1', 0)),
            (
            'GTCCTAGAGCAGCTCCAGCAGGATGGCGGCTCCAGCGTCTCTAAGGCCTGCAGGGGGTCCAGCCCCATGGGGGGCGCCCTAGGCCTCCGACAGCTCCCCATCTGTGCTCCTGCCTGCCGGCCATCCTCAGGCCACTCGCC',
            Interval(22, 20967805, 20967944, 'ENSE00003469659.1', 0))]
        }


def test_constructor(FivePrimeUTRSeq_object_minus_strand):
    res = FivePrimeUTRSeq_object_minus_strand[0]
    assert res == {
        '':
            Interval(22, 22489399, 22509154, "5' UTR", 0, "-"),
        'transcripts': ['ENST00000626650.2'],
        'exons': [(
                  '',
                  Interval(22, 22508659, 22509154, 'ENSE00003739217.1', 0, '-')),
                  ('GATGTGACCTTCTGCCTGGAATAGCTCAAGTTCTTAAAAGTTGCGTTGTAATAAACCTGAG',
                   Interval(22, 22507810, 22507870, 'ENSE00003735702.1', 0, '-')),
                  (
                  'GCTGGGAAGTTCAAGATCAAGATGCTGGACGATTTGGTTCCTTAGTGAAGGCTCTCTTCCTGGCTGGTGGATGACAGCCTTCTTGCTGTGTTCTCACATGACAGAAAGAGGAAGCAAG',
                  Interval(22, 22494063, 22494180, 'ENSE00003744310.1', 0, '-')),
                  ('GTGGCAGTTTATATAAAGGAAGCATTGGGACTTGTGGCCCCACCATTCAGGAATAAAAAAATTAGAAA',
                   Interval(22, 22489399, 22489466, 'ENSE00003762088.1', 0, '-'))]}
